const Card = ({ name, id, professor, onRouteChange} ) => {
    return(
        <div className='tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5'>
            <div>
                <h2 onClick={() => {onRouteChange('infos')}}
                    className='f3 link dim black underline pa3 pointer'>{name}</h2>
            </div>
        </div>
    );
}



export default Card;
